import React, { useState } from "react";
import Head from "./header";
import "./contactus.css";
import Footer from "./footer";

function Contactus() {
  function redToSignin() {
    window.location.href = "/signin";
  }

  return (
    <div>
        <Head/>
      <div className="page">
        <div className="cardBody contactus">
          <div className="hi">
            <p className="hi1">We need your feedback!</p>
            <p className="hi2">Please kindly fill in the form below</p>
          </div>
          <div className="inputBox">
            {/* <div>Firstname</div> */}
            <input type="text" className="input" placeholder="Your full name" />
          </div>

          <div className="inputBox">
            <input type="text" className="input" placeholder="Your contact email" />
          </div>

          <div className="inputBox">
            <textarea type="text" className="input input-text" placeholder="Your Message" ></textarea>
          </div>

          <div className="below">
            <div className="submitBox">
              <button className="signUpBtn">SEND</button>
            </div>

          </div>
        </div>
      </div>
      <Footer/>
    </div>
  );
}

export default Contactus;
